pub enum CompError {
    UnexpectedEOF(String),
    UnexpectedChar(String),
    Overflow(String),
}

pub enum Expression {
    Binary {
        lhs: Box<Expression>,
        operator: Operator,
        rhs: Box<Expression>,
    },
    U64 {
        inner: u64,
    },
    F64 {
        inner: f64,
    },
    Str {
        inner: String,
    },
    Unary {
        operator: Operator,
        inner: Box<Expression>,
    },
}

pub enum Statement {
    ValueInitialization {
        symbol: String,
        value: Expression,
    },
    ValueAssignment {
        symbol: String,
        value: Expression,
    },
}
